import cv2
from arcface.struct_info import *
from face_recognition import implement_method


def run(buffer_data):
    """
    :param buffer_data: 从数据接口获得的图片二进制
    :return: 对比度得分最高的UserID
    """
    # 建立评分字典
    score_dict = {}

    # 是否提前跳出Flag
    flag = False

    # 实例化对象
    im = implement_method()

    dllc = cdll.msvcrt
    # 从数据接口获得图片的二进制，调用extract_features方法获得其人脸特征
    face_feature2 = im.extract_features(buffer_data)

    # 获取用户特征字典集
    features_dict = im.load_features()

    # 和features_dict中的特征进行一一对比
    for key, value in features_dict.items():
        feature = value
        # 将特征构造成模型所需要的形式
        fas = ASF_FaceFeature()
        fas.featureSize = feature.__len__()
        fas.feature = dllc.malloc(fas.featureSize)
        dllc.memcpy(fas.feature, feature, fas.featureSize)
        # 对比两张图片得到评分
        res, score = im.similiarity(fas, face_feature2)
        print("相似度:", score, 'UserID', key)
        score_dict[key] = score
        # 如果对比评分大于0.9或者等于1说明肯定是一个人，直接跳出循环
        if score >= 0.8 or score == 1:
            flag = True
            break
    if flag is True:
        return key
    else:
        score_dict = sorted(score_dict.items(), key=lambda x: x[1], reverse=True)
        key = list(score_dict)[0][0]
        score = list(score_dict)[0][1]
        if score <= 0.5:
            key = '查无此人'
        return key


